import{_ as e,c as a,o as t,a as r}from"./app.425f67e3.js";const b=JSON.parse('{"title":"\u{1F424}\u5C0F\u9EC4\u9E2D\u4E3E\u4E2A\u6817\u5B50\u{1F330}","description":"","frontmatter":{},"headers":[{"level":2,"title":"\u{1F424}\u5C0F\u9EC4\u9E2D","slug":"\u{1F424}\u5C0F\u9EC4\u9E2D"},{"level":2,"title":"\u{1F330}\u5173\u4E8E\u6817\u5B50","slug":"\u{1F330}\u5173\u4E8E\u6817\u5B50"},{"level":2,"title":"\u{1F4D6} \u77E5\u8BC6\u8BC5\u5492","slug":"\u{1F4D6}-\u77E5\u8BC6\u8BC5\u5492"}],"relativePath":"About/AboutDuck.md","lastUpdated":1656280863000}'),p={name:"About/AboutDuck.md"},o=r('<h1 id="\u{1F424}\u5C0F\u9EC4\u9E2D\u4E3E\u4E2A\u6817\u5B50\u{1F330}" tabindex="-1">\u{1F424}\u5C0F\u9EC4\u9E2D\u4E3E\u4E2A\u6817\u5B50\u{1F330} <a class="header-anchor" href="#\u{1F424}\u5C0F\u9EC4\u9E2D\u4E3E\u4E2A\u6817\u5B50\u{1F330}" aria-hidden="true">#</a></h1><blockquote><p>\u5176\u5B9E\u4F60\u53EF\u4EE5\u53D1\u73B0\uFF0C\u{1F424}\u8FD9\u4E2A\u56FE\u6807\u662F\u4E00\u53EA\u5C0F\u9EC4\u9E21\uFF0C\u4F46\u662F\u56E0\u4E3A\u8FD9\u4E2A\u56FE\u6807\u5F88\u53EF\u7231\u3002<br> \u5982\u679C\u3010emoji \u9E2D\u3011\u7684\u8BDD -&gt; \u{1F986}.....</p></blockquote><p>\u4E3A\u4EC0\u4E48\u6211\u7ED9\u6211\u81EA\u5DF1\u7684\u535A\u5BA2\u53D6\u4E86\u4E00\u4E2A\u8FD9\u6837\u7684\u540D\u5B57\u5462\uFF1F\uFF01 \u{1F447}</p><h2 id="\u{1F424}\u5C0F\u9EC4\u9E2D" tabindex="-1">\u{1F424}\u5C0F\u9EC4\u9E2D <a class="header-anchor" href="#\u{1F424}\u5C0F\u9EC4\u9E2D" aria-hidden="true">#</a></h2><p>\u4F60\u662F\u5426\u6709\u542C\u8FC7\u3010\u7A0B\u5E8F\u5458\u4E0E\u5C0F\u9EC4\u9E2D\u3011\u7684\u6545\u4E8B\u5462\uFF1F</p><p>\u5927\u6982\u662F\u8BF4\u4E00\u4E2A\u7A0B\u5E8F\u5458\u9047\u5230\u4E86\u4E00\u4E2ABug\uFF0C\u89E3\u51B3\u4E0D\u4E86\uFF0C\u6101\u7709\u82E6\u8138\u4E00\u5929\u3002</p><p>\u6B63\u597D\u6709\u4E2A\u540C\u4E8B\u8DEF\u8FC7\u95EE\u4ED6\u600E\u4E48\u4E86\uFF0C\u4E8E\u662F\u4ED6\u5411\u8FD9\u4E2A\u540C\u4E8B\u89E3\u91CA\u4E86\u4ED6\u5199\u8FD9\u4E9B\u4EE3\u7801\u7684\u6574\u4E2A\u601D\u8DEF\u548C\u4EE3\u7801\u7EC6\u8282\uFF0C\u8BF4\u7740\u8BF4\u7740\uFF0C\u4ED6\u81EA\u5DF1\u5C31\u60F3\u901A\u4E86...</p><p>\u6709\u65F6\uFF0C\u6211\u4EEC\u9047\u5230\u4E86\u95EE\u9898\uFF0C\u53EF\u4EE5\u628A\u6574\u4E2A\u601D\u8DEF\u8BE6\u7EC6\u5730\u89E3\u91CA\u51FA\u6765,\u634B\u4E00\u904D\uFF0C\u60F3\u60F3\u54EA\u91CC\u4E0D\u5BF9\u3002<br> \u5E76\u4E0D\u4E00\u5B9A\u9700\u8981\u5411\u4EBA\u503E\u8BC9\uFF0C\u53EF\u4EE5\u662F\u522B\u7684\u7269\u4F53\uFF0C\u6BD4\u5982\u4E00\u4E2A\u73A9\u5177\u5C0F\u9EC4\u9E2D\u{1F424}</p><p>\u8FD9\u5C31\u662F\u5927\u540D\u9F0E\u9F0E\u7684 - \u201C\u5C0F\u9EC4\u9E2D\u8C03\u8BD5\u6CD5\u201D\uFF08Rubber Duck Debugging\uFF09</p><blockquote><p>\u7EF4\u57FA\u767E\u79D1\u6709\u89E3\u91CA\uFF1A\u5C0F\u9EC4\u9E2D\u8C03\u8BD5\u6CD5\u662F\u8F6F\u4EF6\u5DE5\u7A0B\u4E2D\u4F7F\u7528\u7684\u8C03\u8BD5\u4EE3\u7801\u65B9\u6CD5\u4E4B\u4E00\u3002\u5C31\u662F\u5728\u7A0B\u5E8F\u7684\u8C03\u8BD5\u3001\u7EA0\u9519\u6216\u6D4B\u8BD5\u8FC7\u7A0B\u4E2D\uFF0C\u8010\u5FC3\u5730\u5411\u5C0F\u9EC4\u9E2D\u89E3\u91CA\u6BCF\u4E00\u884C\u7A0B\u5E8F\u7684\u4F5C\u7528\uFF0C\u4EE5\u6B64\u6765\u6FC0\u53D1\u7075\u611F\u3002<br><a href="https://baike.baidu.com/item/%E5%B0%8F%E9%BB%84%E9%B8%AD%E8%B0%83%E8%AF%95%E6%B3%95/16569594" target="_blank" rel="noopener noreferrer">\u767E\u5EA6\u767E\u79D1\uFF1A\u5C0F\u9EC4\u9E2D\u8C03\u8BD5\u6CD5</a></p></blockquote><p>\u6240\u4EE5\u6211\u66F4\u6362\u4E86\u3010\u65B0\u3011\u7684\u535A\u5BA2\uFF0C\u628A\u6211\u81EA\u5DF1\u5B66\u5230\u7684\u4E1C\u897F\u63CF\u8FF0\u51FA\u6765\u7ED9\u8FD9\u4E2A\u535A\u5BA2\u3010\u{1F424}\u5C0F\u9EC4\u9E2D\u3011</p><p>\u63CF\u8FF0\u7684\u65B9\u5F0F\u6211\u5E0C\u671B\u662F\u50CF\u5BF9\u5973\u670B\u53CB\u90A3\u6837\u6E29\u67D4~ \u7EC6\u5FC3\uFF0C\u5E76\u4E14\u89E3\u91CA\u57CB\u90A3\u4E9B\u4E13\u4E1A\u672F\u8BED~ \u5C31\u50CF\u6211\u8BFB\u4E66\u65F6\u671F\u6559\u6211\u7684\u540C\u5B66\u6570\u5B66\u4E00\u6837\uFF08\u5B9E\u4E0D\u76F8\u7792\uFF0C\u6211\u4E0A\u521D\u4E2D\u9AD8\u4E2D\u7684\u65F6\u5019\u6559\u4EBA\u6570\u5B66\u7279\u522B\u6709\u8010\u5FC3\uFF01\u800C\u4E14\u7279\u522B\u7167\u987E\u57FA\u7840\u8584\u5F31\u7684\u540C\u5B66\uFF0C\u5F53\u5E74\u8FD8\u5F88\u8010\u5FC3\u6559\u6211\u7684\u5973\u670B\u53CB\uFF0C\u867D\u7136\u6700\u540E\u6211\u88AB\u7529\u4E86\uFF0C\u4F46\u7EDD\u4E0D\u662F\u56E0\u4E3A\u6211\u6559\u5979\u6570\u5B66\u54E6\uFF01 \u54C8\u54C8\u54C8~\uFF09</p><p>\u4E00\u65B9\u9762\uFF0C\u6211\u53EF\u4EE5\u6E05\u6670\u7684\u4E86\u89E3\u81EA\u5DF1\u662F\u5426\u638C\u63E1\u8FD9\u9879\u6280\u672F\uFF0C\u6574\u7406\u6210\u6211\u65E5\u540E\u53EF\u4EE5\u7FFB\u770B\u7684\u7B14\u8BB0\u3002\uFF08\u8BDD\u8BF4\u8FD9\u6837\u5F88\u50CF\u201C<a href="https://baike.baidu.com/item/%E8%B4%B9%E6%9B%BC%E5%AD%A6%E4%B9%A0%E6%B3%95/50895393" target="_blank" rel="noopener noreferrer">\u8D39\u66FC\u5B66\u4E60\u6CD5</a>\u201D\uFF09<br> \u53E6\u4E00\u65B9\u9762\uFF0C\u5982\u679C\u5199\u5F97\u597D\uFF0C\u4E5F\u53EF\u4EE5\u5E2E\u52A9\u5230\u5927\u5BB6\u3002</p><h2 id="\u{1F330}\u5173\u4E8E\u6817\u5B50" tabindex="-1">\u{1F330}\u5173\u4E8E\u6817\u5B50 <a class="header-anchor" href="#\u{1F330}\u5173\u4E8E\u6817\u5B50" aria-hidden="true">#</a></h2><p>\u5173\u4E8E\u8FD9\u4E2A\u{1F330}\u6817\u5B50 - \u5176\u5B9E\u5C31\u662F\u4F8B\u5B50\uFF01</p><p>\u6211\u770B\u8FC7\u5F88\u591A\u4EBA\u7684\u6587\u7AE0\u3001\u6559\u7A0B\u3001\u7B14\u8BB0\uFF0C\u6709\u4E00\u4E9B\u5199\u5F97\u5F88\u5DEE\uFF0C\u751A\u81F3\u6F14\u793A\u7684\u4EE3\u7801\u90FD\u7CCA\u5728\u4E00\u5757\uFF0C\u53EF\u8BFB\u6027\u8D85\u7EA7\u5DEE\uFF08\u7279\u522B\u662FCSDN\u4E0A\u90A3\u4E9B\u590D\u5236\u7C98\u8D34\u7684\u4EE3\u7801\uFF0C\u8FDEMarkDown\u90FD\u4E0D\u4F1A\u5199\uFF09\u3002</p><p>\u6709\u7684\u6559\u7A0B\u8BF4\u5F97\u5F88\u660E\u767D\uFF0C\u6613\u61C2\u3002\u800C\u4E14\u4E3E\u5F97\u4F8B\u5B50\u{1F330}\u7279\u522B\u751F\u52A8\u5F62\u8C61\u3002 \u6240\u4EE5\u6211\u60F3\u6211\u7684\u7B14\u8BB0\u4E5F\u8981\u591A\u70B9\u4E3E\u4F8B\u5B50\uFF0C\u56E0\u4E3A\u6211\u4E4B\u524D\u770B\u4E86\u5F88\u591A\u5B98\u65B9\u6587\u6863\uFF0C\u867D\u7136\u4E13\u4E1A\u3001\u9F50\u5168\uFF0C\u4F46\u662F\u9762\u5BF9\u4E00\u4E2A\u65B0\u624B\uFF0C\u6216\u8005\u521A\u63A5\u89E6\u8FD9\u4E2A\u4E1C\u897F\u7684\u4EBA\u6765\u8BF4\uFF0C\u5E94\u8BE5\u8981\u5148\u77E5\u9053\u5B83\u5927\u6982\u600E\u4E48\u7528\uFF0C\u4EE5\u53CA\u5E38\u89C4\u7684\u4F7F\u7528\u65B9\u5F0F\u3002\u6700\u540E\u518D\u53BB\u6DF1\u5165\u7684\u4E86\u89E3\u5B83\u3002</p><h2 id="\u{1F4D6}-\u77E5\u8BC6\u8BC5\u5492" tabindex="-1">\u{1F4D6} \u77E5\u8BC6\u8BC5\u5492 <a class="header-anchor" href="#\u{1F4D6}-\u77E5\u8BC6\u8BC5\u5492" aria-hidden="true">#</a></h2><p>\u5927\u5BB6\u542C\u8FC7\u{1F4D6}\u77E5\u8BC6\u8BC5\u5492\u5417\uFF1F</p><p>\u6211\u7B2C\u4E00\u6B21\u542C\u8BF4\u662F\u5728\u300A\u590D\u4EC7\u8005\u8054\u76DF3\u300B\u91CC\uFF0C\u706D\u9738\u5BF9\u94A2\u94C1\u4FA0\u6258\u5C3C\u8BF4\u7684\uFF0C\u201C\u4E0D\u662F\u53EA\u6709\u4F60\u4E00\u4E2A\u4EBA\u88AB\u77E5\u8BC6\u8BC5\u5492\u4E86\u201D\uFF0C\u90A3\u65F6\u5019\u4EE5\u4E3A\u662F\u7FFB\u8BD1\u95EE\u9898\uFF0C\u602A\u602A\u7684\u3002</p><p>\u540E\u6765\u6211\u5728\u4E00\u4E2A\u89C6\u9891\u535A\u4E3B\u90A3\u91CC\u4E86\u89E3\u5230\u3002\u5176\u5B9E\u201C\u77E5\u8BC6\u8BC5\u5492\u201D\u5927\u6982\u8BF4\u7684\u5C31\u662F\uFF0C\u5F53\u4F60\u5B66\u4F1A\u4E00\u4E2A\u77E5\u8BC6\u65F6\uFF0C\u4F60\u5C31\u88AB\u5B83\u8BC5\u5492\u4E86\u3002</p><p>\u5982\u679C\u73B0\u5728\u7ED9\u4F60\u4E00\u9053\u3010\u9E21\u5154\u540C\u7B3C\u3011\u7684\u95EE\u9898\uFF0C\u4F60\u7B2C\u4E00\u65F6\u95F4\u5C31\u4F1A\u60F3\u5230\u7528\u5217\u3010\u672A\u77E5\u6570X\u548CY\u3011\uFF0C\u4F46\u662F\u5C0F\u5B66\u6CA1\u5B66\u8FC7\u89E3\u3010\u4E8C\u5143\u4E00\u6B21\u65B9\u7A0B\u3011\u3002\u8BA9\u4F60\u7528\u5C0F\u5B66\u751F\u7684\u65B9\u5F0F\u6765\u89E3\u8FD9\u9053\u9898\u7684\u65F6\u5019\uFF0C\u4F60\u53EF\u80FD\u5C31\u4E0D\u77E5\u9053\u8981\u600E\u4E48\u89E3\u4E86\uFF0C\u8FD9\u5C31\u662F\u4F60\u88AB\u3010\u4E8C\u5143\u4E00\u6B21\u65B9\u7A0B\u3011\u8FD9\u4E2A\u77E5\u8BC6\u8BC5\u5492\u4E86\u3002 \u5C0F\u5B66\u7684\u65F6\u5019\uFF0C\u8001\u5E08\u544A\u8BC9\u4F60\uFF0C3\u96642\u7B49\u4E8E1\u4F591\uFF0C\u540E\u9762\u6559\u4F603\u96642\u7B49\u4E8E1.5\u3002\u5C0F\u5B66\u8001\u5E08\u8BF4\uFF0C1\u6CA1\u529E\u6CD5-2\u56E0\u4E3A\u4E0D\u591F\u51CF\u3002\u540E\u6765\u5B66\u4E86\u8D1F\u6570\uFF0C\u77E5\u90531-2\u662F-1\u3002</p><p>\u6211\u8BA4\u4E3A\u5B66\u4E60\u662F\u5FAA\u5E8F\u6E10\u8FDB\u7684\uFF0C\u6559\u5B66\u4E5F\u662F\u3002\u6CA1\u5FC5\u8981\u4E00\u4E0A\u6765\u5C31\u5B66\u5F97\u5F88\u6DF1\uFF0C\u8BB2\u5F97\u5F88\u6DF1\u3002<br> \u5F88\u591A\u4EBA\u88AB\u77E5\u8BC6\u8BC5\u5492\u4E86\uFF0C\u6240\u4EE5\u7406\u6240\u5E94\u5F53\u7684\u89C9\u5F97\u522B\u4EBA\u7406\u89E3\u8D77\u8FD9\u4E2A\u6765\u4E0D\u96BE\u3002</p>',23),i=[o];function n(c,d,s,h,l,u){return t(),a("div",null,i)}var f=e(p,[["render",n]]);export{b as __pageData,f as default};
